import React from 'react';

class StopWatch extends React.Component{
    constructor(){
        super()
        this.state={
            time : 0
        }
    }
    render(){
        return(
            <div>
                {this.state.time}
                <hr></hr>
                <button onclick={this.handleStart}>start</button>
                <button>stop</button>
            </div>
        )
    }
}
export default StopWatch;
